import Navbar from "../components/Navbar";

const Index = () => {
  return (
    <div>
      <h1>Hello This is the Index Page</h1>
    </div>
  );
};

Index.getInitialProps = async ({ req }) => {
  const res = await axios.get("https://jsonplaceholder.typicode.com/posts");
  const { data } = res;
  console.log(data[0]);
};

export default Index;
